import "./Sidebar.css";
import image from '../../assest/zgamer.png';
import { Link } from 'react-router-dom'
import Modal from 'react-modal';
import { useState } from "react";

const Sidebar = () => {

 const [newGame, setNewGame] = useState({
  name: "",
  desc: "",
  plataforms: [],
  image: "",
  release: "",
  rating: 0
 });


const handleChange = (e) => {

  setNewGame({
    ...newGame,
   [e.target.name]: e.target.value
  })

}

  const customStyles = {
    
    overlay: {
      backgroundColor: '#181a2694',
    },
    content: {
      top: '50%',
      left: '50%',
      right: 'auto',
      bottom: 'auto',
      marginRight: '-50%',
      transform: 'translate(-50%, -50%)',
      backgroundColor: ' rgb(77, 72, 72)',
      
    },
  };

  const [modalIsOpen, setIsOpen] = useState(false);


  function closeModal() {
    setIsOpen(false);
  }

  return (
    <div className="sidebarcontainer">
      <div className="top">
        <div className="logo">
          <Link to={'/'}>
          <img src={image} alt="" />
          </Link>
        </div>
      </div>
      <div className="center">
        <div className="containersidebarcenter">
          <ul className="ulsidebarmenu">
            <div className="active">
              <li>
                <ion-icon size="large" name="game-controller-outline" />
                Games
              </li>
            </div>
          
            <div className="">
              <li onClick={ () => setIsOpen(true)}>
                <ion-icon size="large" name="add-circle-outline" />
                Add Games
              </li>
            </div>
          </ul>
         
        </div>
      </div>
      <div className="bottom">
      <Modal isOpen = { modalIsOpen } 

        onRequestClose = { closeModal } 
        style = { customStyles } 
        contentLabel = "Ejemplo Modal" >
      <form >
        <h1>Create Game</h1>
        <div className="nameGame">
          <label htmlFor="name">Name:</label>
          <input type="text" id="name" onChange={handleChange}/>
        </div>
        <div className="descGame">
          <label htmlFor="name">Desciption:</label>
        <textarea type="text" id="descriptiongame"/>
        </div>
        <div className="platformsGame">
          <label htmlFor="name">Plataformas</label>
        <input type="text" id="name"/>
        </div>
        <div className="imageGame">
          <label htmlFor="name">Image:</label>
        <input type="text" id="name"/>
        </div>
        <div className="releaseGame">
          <label htmlFor="name">Release:</label>
        <input type="date" id="name"/>
        </div>
        <div className="ratingGame">
          <label htmlFor="name">Rating:</label>
        <input type="number" id="name"/>
        </div>
        <button type="submit">Agregar Juego</button>
      </form>
      </Modal>
       
    
      </div>
    </div>
  );
};

export default Sidebar;
